import React from 'react';
import { Switch, Route } from 'react-router-dom';

import './App.css';
import HomePage from './pages/home-page/home-page.page';

function App() {
  return (
      <div className="App">
          <Switch>
              <Route exact path='/' component={HomePage}/>
          </Switch>
      <h1>Hello</h1>
    </div>
  );
}

export default App;
